var tipuesearch = {"pages": [{'title': 'W1', 'text': '[2001:288:6004:17::53]:3128 \n 140.130.17.50:3128 \n tcp/ip==transmision control protocol/internet protocol \n port\xa0 \n date 資料 \n transmit 傳輸 \n control 控制 \n version=edition 版本 \n super computer 超級電腦 \n batch computation 批次運算 \n mainframe 伺服器主機 \n server 伺服器 \n cluster 叢集 \n personal computer \n microcontroler \n mobile phone \n IPv4 version4 IP4個區段用.區隔 \n IPv6 version4 IP6個區段用:區隔 \n 140.130.17.254(系gateway通道) \n 140.130.1.*(學校主幹) \n NAT network address translation \n internal network(內部網路)192.168.* \n ip address mapping 對應 \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W6', 'text': 'portable obs \n google hangout meet \n streeming and recording \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': 'grouping and meet \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '組別:第四組 \n 組長:50833102 \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '', 'tags': '', 'url': 'W9.html'}, {'title': '電腦軟硬體簡介', 'text': '\n \n \n \n \n \n 機殼 \n 容納和保護主機營體的主機殼 \n \n 中央處理器(CPU) \n 又稱為電腦的心臟，而CPU主要工作是算術、運輯運算，解讀電腦內的每個指令來控制運作。 \n  電源(Power) \n \n 是提供內接式元件電力來源的組件，他將市電轉換為直流電供給其他元件使用。 \n \n \n 主機板 \n \n 主機板的功能主要在承戴其插卡，所有電腦裡的東西都會接到主機板 ，它們之間要相互的傳資料也是經過主機板，之後再傳到對方，簡單的來說，它就像一個轉運站一樣。  \n \n 顯示卡(VGA ) \n 顯示卡在電腦中主要作用就是把電腦計算出來的文字與圖形表現在顯示器上。 \n \n \n  音效卡 \n 可說是現在多媒體電腦的必備元件之一，負責電腦音訊的處理。 \n \n \n 記憶體(RAM) \n 記憶體的主要功用是暫存資料，當它被使用時，系統可以從RAM上存取資料。 \n \n \n  硬碟 \n 硬碟就是電腦中負責儲存資料的工具，電腦中的大小資料均可以在此找到。 \n \n \n \n', 'tags': '', 'url': '電腦軟硬體簡介.html'}, {'title': '網路架構與設定簡介', 'text': '', 'tags': '', 'url': '網路架構與設定簡介.html'}]};